import React from 'react';

function Content() {
  return (
    <div className='text-white content-text'>
      <h1 className='text-base'>About</h1>
      <p className='text-xs'>
        I am a frontend developer with a particular interest in making things simple and automating
        daily tasks. I try to keep up with security and best practices, and am always looking for
        new things to learn.
      </p>
      <h1 className='text-base'>Interests</h1>
      <p className='text-xs'>
        Food expert. Music scholar. Reader. Internet fanatic. Bacon buff. Entrepreneur. Travel geek.
        Pop culture ninja. Coffee fanatic.
      </p>
    </div>
  );
}

export default Content;
